import { ListGroup } from 'react-bootstrap';
import { uuidv4 as v4 } from 'uuid';

function List({ list }) {
    return (
        <ListGroup>
            {list.map((item) => (
                <ListGroup.Item key={uuidv4()}>
                    <span>{item.link}</span> ---
                    <span style={{ color: 'darkorange' }}>
                        {item.short_link}
                    </span>
                </ListGroup.Item>
            ))}
        </ListGroup>
    );
}

export default List;
